  state = { playlists: [] };

  componentDidMount() {
    fetch('/playlists')
    .then(res => res.json())
    .then(users => this.setState({  users  }));

    console.log(playlists);
  }


  render() {
    return (
      <div className="App">
       <h1>Playlists</h1>
       <ul>
         {this.state.playlists.map(playlist => 
         <li key={  playlist.name  }></li>)}
       </ul>
      </div>
    );
  }
}

export default App;
